import React, { Component } from "react";
import { Row, Col } from "antd";
class AppFooter extends Component {
  state = {};
  render() {
    return (
      <Row>
        <Col>
          <div style={{ textAlign: "center" }}>
            SUSTech Doc Â©2019 Created by Xinghe Yao
          </div>
        </Col>
      </Row>
    );
  }
}

export default AppFooter;
